import "./ValueCard/index";
import { ValueCard } from "./ValueCard";

export function ValueList() {
  const listValue = [
    {
      valueName: "Pagamento",
      valueType: "Entrada",
      valueDescription: "R$ 1,300",
    },
    {
      valueName: "Despesas",
      valueType: "Saída",
      valueDescription: "R$ 200,00",
    },
    {
      valueName: "Despesas",
      valueType: "Saída",
      valueDescription: "500,00",
    },
  ];

  return (
    <section className="resume-container">
      <div className="resume_header flex">
        <p className="description">Resumo Financeiro</p>
        <div className="buttons-container">
          <button type="button gray_button">Todos</button>
          <button type="button gray_button">Entradas</button>
          <button type="button gray_button">Despesas</button>
        </div>
      </div>
      <ul className="resume-list">
        {listValue.map((index, value) => (
          <ValueCard key={index} value={value} />
        ))}
      </ul>
    </section>
  );
}
